// src/components/UserNavbar.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './UserNavbar.css';

const UserNavbar = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <nav className="user-navbar">
      <div className="navbar-logo">
        <h1>BukSU Lost and Found</h1>
      </div>
      <div className="navbar-links">
        <ul>
          <li><Link to="/user-home">Home</Link></li>
          
          {/* Dropdown for Categories */}
          <li className="dropdown" onClick={toggleDropdown}>
            <span>Categories</span>
            {dropdownOpen && (
              <ul className="dropdown-menu">
                <li><Link to="/category/lost-items">Lost Items</Link></li>
                <li><Link to="/category/found-items">Found Items</Link></li>
                <li><Link to="/category/others">Others</Link></li>
              </ul>
            )}
          </li>

          <li><Link to="/about">About Us</Link></li>
          <li><Link to="/contact">Contact Us</Link></li>
          
          {/* Profile and Logout */}
          <li><Link to="/profile"><img src="user-icon.png" alt="Profile" /></Link></li>
          <li><Link to="/logout">Logout</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default UserNavbar;
